import update from 'react-addons-update'

import {
  ADD_NODE,
  REMOVE_NODE,
  EDIT_TRANSLATION,
  SAVE_TREE_PENDING,
  SAVE_TREE_FULFILLED,
  SAVE_TREE_REJECTED } from './actions'


function addNode(nodes, parentId, newKey, nodeLanguages) {
  let emptyTranslations = {}  // eslint-disable-line prefer-const
  nodeLanguages.forEach(value => emptyTranslations[value] = '')
  const newNodes = update(
    nodes, {
      // add new item to nodes
      $merge: { [newKey]: {
        key: newKey,
        subnodes: [],
        translations: emptyTranslations,
      } },

      [parentId]: { subnodes: { $push: [newKey] } }
    })

  return newNodes
}

function removeNode(nodes, action) {
  // remove item from parents' subnodes
  const newNodes = update(
    nodes, {
      [action.parentId]: { subnodes: { $splice: [[action.index, 1]] } },
    })

  // remove from nodes
  delete newNodes[action.id]

  // action.parentId
  return newNodes
}

export function tree(state = { nodes: {}, dirty: false }, action) {
  switch (action.type) {
  case ADD_NODE:
    return {
      dirty: true,
      nodes: addNode(state.nodes, action.parentId, action.newKey, action.languages)
    }
  case REMOVE_NODE:
    return {
      dirty: true,
      nodes: removeNode(state.nodes, action)
    }
  case EDIT_TRANSLATION:
    const language = action.language
    return {
      dirty: true,
      nodes: update(
        state.nodes, {
          [action.id]: { translations: { [language]: { $set: action.value } } },
        })
    }
  case SAVE_TREE_FULFILLED:
    return {
      dirty: false,
      nodes: state.nodes
    }
  default:
    return state
  }
}

export function rootId(state = 'root', action) {
  return state
}

export function defaultLanguage(state = 'en', action) {
  return state
}

export function languages(state = ['en'], action) {
  return state
}

const defaultState = { isPending: false, status: '', message: '' }

export function saveTree(state = defaultState, action) {
  switch (action.type) {
  case SAVE_TREE_PENDING:
    return {
      isPending: true,
      status: '',
      message: ''
    }
  case SAVE_TREE_FULFILLED:
    return {
      isPending: false,
      status: action.payload.status,
      message: action.payload.message
    }
  case SAVE_TREE_REJECTED:
    return state
  default:
    return state
  }
}

import normalizr from 'normalizr'
import 'whatwg-fetch'


const Schema = normalizr.Schema
const arrayOf = normalizr.arrayOf

const nodeSchema = new Schema('nodes', { idAttribute: 'key' })

nodeSchema.define({
  subnodes: arrayOf(nodeSchema),
})

export function normalizeData(taxonomyJson) {
  return normalizr.normalize(taxonomyJson, nodeSchema)
}

function buildChild(nodes, id) {
  const node = nodes[id]
  return {
    key: id,
    translations: node.translations,
    subnodes: node.subnodes.map(childId => buildChild(nodes, childId))
  }
}

function buildTree(nodes, rootId) {
  const rootNode = nodes[rootId]
  const subnodes = rootNode.subnodes.map(id => buildChild(nodes, id))
  return {
    key: rootId,
    title: rootNode.title,
    subnodes: subnodes,
    default_language: rootNode.default_language,
    languages: rootNode.languages
  }
}

export function asyncSaveTree(nodes, rootId) {
  const viewUrl = $('base').attr('href') + '/@@taxonomy-import'
  const hashes = window.location.href.slice(
    window.location.href.indexOf('?') + 1).split('&')
  const taxonomyParam = hashes.map(hash => hash.split('=')).find(
    param => param[0] === 'taxonomy')
  const tree = buildTree(nodes, rootId)
  const rootNode = nodes[rootId]
  return fetch(viewUrl, {
    credentials: 'include',
    method: 'post',
    headers: {
      'Accept': 'application/json',
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({
      languages: rootNode.languages,
      tree: tree,
      taxonomy: taxonomyParam[1]
    })
  }).then(response => response.json())
}

import React, { Component, PropTypes } from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'

import Tree from '../components/Tree'
import MessageBox from '../components/common/MessageBox'
import Spinner from '../components/common/Spinner'
import * as actionCreators from '../actions'


class App extends Component {

  static propTypes = {
    defaultLanguage: PropTypes.string.isRequired,
    dispatch: PropTypes.func.isRequired,
    dirty: PropTypes.bool.isRequired,
    languages: PropTypes.array.isRequired,
    nodes: PropTypes.object.isRequired,
    rootId: PropTypes.string.isRequired,
    saveTree: PropTypes.object.isRequired,
  }

  render() {
    const { defaultLanguage, dispatch, dirty, languages, nodes, rootId,
            saveTree } = this.props
    const boundActionCreators = bindActionCreators(actionCreators, dispatch)
    const portalURL = $('base').attr('href')
    const { isPending, message, status } = saveTree
    return (
      <div>

      { isPending ? <Spinner imageURL={ portalURL + '/spinner.gif' } /> : null }

      { status ? <MessageBox status={ status } message={ message } /> : null }

      { dirty ? <MessageBox status="error" message="Changes have been made but you have to click on submit button to save these changes." /> : null }

      <Tree dirty={ dirty } nodes={ nodes } rootId={ rootId }
            defaultLanguage={ defaultLanguage } languages={ languages }
            { ...boundActionCreators }
      />
      </div>
      )
  }

}

function select(state) {
  return {
    defaultLanguage: state.defaultLanguage,
    dirty: state.tree.dirty,
    languages: state.languages,
    nodes: state.tree.nodes,
    rootId: state.rootId,
    saveTree: state.saveTree
  }
}

// Wrap the component to inject dispatch and state into it
export default connect(select)(App)

