import { asyncSaveTree } from './api'

/*
 * action types
 */

export const ADD_NODE = 'ADD_NODE'
export const REMOVE_NODE = 'REMOVE_NODE'
export const EDIT_TRANSLATION = 'EDIT_TRANSLATION'
export const SAVE_TREE_PENDING = 'SAVE_TREE_PENDING'
export const SAVE_TREE_FULFILLED = 'SAVE_TREE_FULFILLED'
export const SAVE_TREE_REJECTED = 'SAVE_TREE_REJECTED'

/*
 * action creators
 */

export function addNode(parentId, index, newKey, languages) {
  return { type: ADD_NODE, parentId, index, newKey, languages }
}

export function removeNode(parentId, id, index) {
  return { type: REMOVE_NODE, parentId, id, index }
}

export function editTranslation(id, language, value) {
  return { type: EDIT_TRANSLATION, id, language, value }
}

export function saveTree(nodes, rootId) {
  // post tree to plone view
  return {
    types: [
      SAVE_TREE_PENDING,
      SAVE_TREE_FULFILLED,
      SAVE_TREE_REJECTED
    ],
    payload: {
      data: { nodes: nodes, rootId: rootId },
      promise: asyncSaveTree(nodes, rootId)
    }
  }
}

import React, { Component, PropTypes } from 'react'
import TreeView from 'react-treeview'

import AddNodeButton from './AddNodeButton'
import SubTree from './SubTree'


export default class Tree extends Component {

  static propTypes = {
    defaultLanguage: PropTypes.string.isRequired,
    dirty: PropTypes.bool.isRequired,
    nodes: PropTypes.object.isRequired,
    rootId: PropTypes.string.isRequired,
    saveTree: PropTypes.func.isRequired,
  }

  handleClick(e) {
    const { nodes, rootId, saveTree } = this.props
    e.preventDefault()
    saveTree(nodes, rootId)
  }

  handleBack(e) {
    e.preventDefault()
    window.location.href = $('base').attr('href') + '/@@taxonomy-settings'
  }

  render() {
    const { dirty, rootId, nodes, defaultLanguage, ...other } = this.props
    const label = nodes[rootId].title
    const subnodes = nodes[rootId].subnodes
    return (
      <div>
      <h1>Edit taxonomy data</h1>
      <TreeView key={ rootId } nodeLabel={ label }>
        { subnodes.length === 0 ?
          <AddNodeButton { ...other } parentId={ rootId }
                         title="Add a term inside this node"
          >
            <i className="icon-flow-split"></i>
          </AddNodeButton>
          : null }

        { subnodes.map((childId, index) => (
          <SubTree id={ childId }
                   parentId={ rootId }
                   defaultLanguage={ defaultLanguage }
                   index={ index }
                   nodes={ nodes }
                   { ...other }
                   { ...nodes[childId] }
          />)
        ) }
      </TreeView>
      <div className="formControls">
        <input className="submit-widget button-field context allowMultiSubmit"
               type="submit" value="Submit"
               disabled={ !dirty ? 'disabled' : null }
               onClick={ this.handleClick.bind(this) }
        />


        <input className="submit-widget button-field standalone" id="back"
               onClick={ this.handleBack } type="submit"
               value="Back to settings"
        />
      </div>
      </div>
      )
  }

}

import React, { Component, PropTypes } from 'react'


export default class Spinner extends Component {

  static propTypes = {
    imageURL: PropTypes.string.isRequired,
  }

  render() {
    const imageURL = this.props.imageURL
    return (
        <div id="ajax-spinner" style={ { display: 'block' } }>
          <img src={ imageURL } alt=""/>
        </div>
      )
  }

}

import React, { Component, PropTypes } from 'react'


export default class MessageBox extends Component {

  static propTypes = {
    message: PropTypes.string.isRequired,
    status: PropTypes.string.isRequired,
  }

  render() {
    const { message, status } = this.props
    return (
      <dl className={ 'portalMessage ' + status }>
        <dt>{ status }</dt>
        <dd>{ message }</dd>
      </dl>
      )
  }

}

